import React from 'react';
import NavItem from './NavItem'

const MAIN_SECTIONS = ['Portfolio', 'About', 'Resume', 'Blog']

function MainNav(){

  const NavItems = MAIN_SECTIONS.map((sections) => (
    <NavItem title={sections} />
  ))
  return (
    <NavItem />
  )
}

export default MainNav;
